INSERT INTO `anomalie` (`idEssai`, `quiss_mpti`, `autre`, `descriptif`, `heure`, `eurosPerdus`, `status`) VALUES
(7528, 'QUISS', 3, '- pas de poignée pour la manutention\r\n- Quasi-static a 55HZ et non 35Hz', '', '', 0),
(7782, 'QUISS', 6, 'La procédure modifié comporte une erreur : Dans la partie Spray test une inversion de champs (en mode CAL1) a était faite quand on a intégré la RFD\r\nBande Ku et C sont inversées -&gt; La procédure à était REDLINE avec IES et QA', '', '', 0),
(8499, 'QUISS', 1, 'vis talon/rondelle interface bloquée\r\n-&gt; arrachement de l''insert dans la rondelle interface', '', '1', 0),
(9444, 'QUISS', 3, '- Pas de poignées de transport équipement\r\n- Problème de bruit de mesure sur monitoring équipement. (1/2 journée)', '', '', 1),
(12133, 'QUISS', 3, '', '', '', 0),
(12764, 'QUISS', 3, 'Savers LNA non serrés sur deux tranches.', '4', '0.4', 1),
(12800, 'QUISS', 6, 'Bruit suspect lors de la vibration dans l''axe Y (dernier axe). l''équipement à besoin d''être démonter pour vérifier le serrage des cartes et pour investiguer sur l''origine du bruit', '', '', 1),
(12857, 'QUISS', 6, '', '', '', 0),
(12873, '', 5, 'étiquettes collées sur les capots protecteurs des macros', '1', '', 0),
(12874, '', 5, 'shift en amplitude sur axe X et Z\r\nattente validation et autorisation démontage', '6', '', 0),
(12891, 'QUISS', 3, 'Etiquette équipement collé sur un capot pour le PE3927', '', '', 1),
(12912, 'QUISS', 5, 'Durant les essais de micro-phonie, l''équipement présentait une raie anormale au niveau des mesures monitoring. Les investigations pour en déterminer la source ont été faite sur pot vibrant et ont duré environ 3 shift', '24', '', 1),
(12918, 'QUISS', 5, 'Le montage des coax sur cet équipement empêchait la fixation l''outillage de transport sur l''équipement. L''essais a donc été reporté.', '4', '', 1),
(12959, 'QUISS', 3, 'man&lt;ue manille pour realisation des test\r\nBanc de tranciton non modifié pour prise en compte rex précedent', '', '', 0),
(12960, 'QUISS', 1, '\r\n\r\nRemarques sur la documentation : \r\n-	Vue éclatée des assemblages nécessaires (façon revue technique automobile) car les assemblages ne sont pas symétriques (ex : détail de la zone A).\r\n-	Préciser de ne pas serrer les écrous sur les axes des ferrures du bras.\r\n-	Manque détail de la zone de traction (type d’élingue, longueur d’élingue, manille, mousqueton, …).\r\n-	Manque détail de la zone de la poulie renvoie d’angle  (hauteur de la poulie, rehausse sous la poulie, …).\r\nRemarque sur le moyen de test : \r\n-	Identifier physiquement chaque pièce.\r\n-	Mettre une protection en cas de chute du bras  ( filet, mousse, …).\r\n-	Graver la longueur sur les médailles des élingues.\r\n-	Manchonner avec de la gaine les sertissages des élingues (risque de blessure avec les brins)\r\n-	Remplacer des roues fixes par des roues pivotantes.\r\n-	Mettre des supports permettant de stocker les second jeu de barre de guidage.\r\n-	Ajouter un support pour pré-positionner la poulie B.\r\n-	Approvisionner le matériel nécessaire à la réalisation du test ( clé plate, jeu de clé Allen, …).\r\n-	Faciliter l’accès à l’opérateur Sécuriser le zone.\r\n-	Prévoir la vérification des élingues, manille etc.. par un organisme de contrôle.\r\n-	Modifier la zone de test de façon : \r\n-	à ce que l’opérateur puisse effectuer le test en toute sécurité ou bien fournir les outils adaptés. (longue clé à cliquet).\r\n-	à maintenir en position fixe le dynamomètre lors de la mesure.\r\n\r\n\r\nD’une façon générale pour le test du bras APM, 3 personnes sont actuellement nécessaires. Si les modifications demandées sont effectuées, 2 personnes suffiront.\r\n', '2', '', 1),
(13053, 'QUISS', 6, 'Problème de baie pour recette équipement, perte de plus d''1/2 journée', '', '', 1),
(13262, 'QUISS', 3, 'Plaque non Ok', '', '', 1),
(13333, '', 4, 'Des vis d''un dummy de la source se sont desserrées pdt les runs Axe X', '4', '0', 0),
(13340, '', 1, 'Fuite sur le flexible de compensation de charge\r\ndémontage de la conf et basculement ont été nécessaires pour réparation\r\n', '8', '', 0),
(13343, 'QUISS', 1, 'Le pot C335 chauffe et necessite une longue sequence de refroidissement entre chaque run', '', '', 0),
(13380, 'QUISS', 6, 'La configuration ADS ne peut pas être mise en place sur l''outillage prévu 1540153. (panneau nord 1468450 et reglette de test de protection EMC 1540155.\r\nLe problème vient du mauvais perçage de la protection EMC , les côtes sont mauvaises.\r\nLes equerres centrales 1540700 ne sont pas gravées, une sert pour les essais acoustiques et l''autre pour les essais vibrations. ', '8', '', 1),
(13409, 'QUISS', 5, '4 vis d''assemblage se dévissent lors du premier RNDS', '5', '', 0),
(13424, 'QUISS', 5, 'Accroc au niveau de la bride du filtre', '1', '', 1),
(13425, 'QUISS', 5, 'Manque un percage sur la plaque de vibration\r\n-&gt; verifier les autre plan de percage de la plaque', '2', '', 0),
(13467, 'QUISS', 3, 'procedure non figée', '', '', 1),
(13475, 'QUISS', 3, 'Absence d''outillage de manutention de l''ilot SW\r\nErreur de conception de l''outillage de transport de l''ilot RT : cadre touchant les coax (voir photo) ===&gt; prévoir des points de fixation d''anneaux pour manutention avec pont roulant car l''equipement est un peu lourd a manipuler avec de simples poignées lors des essais vib', '', '', 0),
(13489, 'QUISS', 3, 'Le client s''est aperçu au dernier moment que la conf vib de l''équipement n''était pas conforme\r\nil faut démonter des charges RF avant vib', '4', '', 1),
(13511, 'QUISS', 5, 'scotch kapton présent sous la semelle de l''equipement (présent a la livraison)\r\nl''équipement ne portant pas plan sur la plaque de vib ... démontage et constat', '1', '', 0),
(13551, 'QUISS', 3, 'Petit 1 - colonette de maintien de coax, collé au dessus d''un point de fixation de l''équipement, ne permettant pas de fixer l''equipement correctement. \r\nPetit 2 - Equipement livré dans une caisse, sans mousse et libre de tout mouvement. ', '', '', 1),
(13657, 'QUISS', 6, '', '', '', 0),
(13727, 'QUISS', 6, '4 Savers non serrés\r\nNQDITT-311\r\nErreur de fréquences\r\nNQDITT-312\r\n', '', '', 0),
(13834, 'QUISS', 5, 'NQDITT-338\r\n5db out of specification, nombreuses investigations, fuite localisée sur le filtre mecanique', '', '', 1),
(13931, 'QUISS', 5, 'Beaucoup de PB de banc de test (&gt;1j de perdu ) puis arrêt des tests pour réparartion d''un tiroir de la baie de test', '', '', 0),
(14029, 'QUISS', 5, 'L''OMUX dans la procédure EMC de 11Cx est un type 1.\r\nRésa Type 1 alors que la gamme et l''étiquette équipement parle d''un TYPE 2 \r\nD''aprés les LP il s''agit bien d''un TYPE 1.\r\nQUISS NQDITT-310', '1', '', 0),
(15675, 'QUISS', 4, 'Il n''y a pas de palonnier pour installer la source sur le moyen d''essai.', '2', '', 0),
(15683, 'QUISS', 6, 'probléme de baie l''essai est annulé et reporté\r\n', '', '', 0),
(15685, 'QUISS', 3, 'Annulé pour problème de baie!!!\r\n', '', '', 0),
(15852, 'QUISS', 3, 'pas de poignées transport équipement', '', '', 1),
(15959, 'QUISS', 1, 'NQDITE-2230\r\nNQDITT-302', '300', '', 1),
(16092, 'QUISS', 5, 'Procédure demandant mesure Grounding sur 4 fausses masses\r\nQUISS NQDITT-309', '10', '', 0),
(16392, 'QUISS', 6, 'UIYUIOYOY', '', '', 0),
(16462, 'QUISS', 6, 'Equipement amené une première fois en vibrations, mais un test précédent avait été oublié. Une fois le test effectué l''équipement revient une deuxième fois aux vibrations, mais celui-ci est stoppé, car il y a un NC détecté au dernier moment sur le test qui avait été oublié', '', '', 1),
(16572, 'QUISS', 1, 'perte de contact avec un cellule de force sommée : perte de temps pour déterminer laquelle..', '', '', 1),
(16685, 'QUISS', 5, 'HS de 27dB sur l''harmonique 4 de FC (env 30dB d''écart vs autres modèles mesuré à4Fc en sortie du SSPA)', '4', '', 0),
(17721, 'QUISS', 3, 'bruit anormal sur le dernier axe provenant de l''equipement (pas de modif du comportement modal donc structure ok)\r\napres examen des courbes du temporel, forte probabilité d''une vis ou corps etranger bagotant a l''intérieur de l''eqpt', '20', '', 0),
(18207, 'QUISS', 5, 'NQDITT-339\r\npb sur un saver mdm lors d''un montage-démontage fait le client. Retour de l équipement chez LPH pour réparation', '', '', 0),
(18277, 'QUISS', 6, 'NQDITT-331\r\nSur le RS on doit faire du 10.5V/m entre 35.5GHz et 36 GHz\r\nVu qu’on n’as plus l’ampli on ne saura pas faire ce niveau de champ (au mieux 5 à 7V/m).\r\n', '', '', 0),
(18372, 'MPTI/NC', 1, 'depassement des alarmes sur le pilotage sur une bande de 30Hz autour de 700 Hz lors du test acceptance Y', '8', '', 0),
(18482, 'QUISS', 6, 'NQDITT-333\r\nFonte de fusible', '', '', 0),
(18497, 'QUISS', 5, 'NQDITT-340\r\ndefault helicoil sur une bride guide d''onde  WR34 à l''entrée d''un accès RF\r\n', '', '', 0),
(18650, 'QUISS', 5, 'probleme de planeité de l''équipement. Il doit etre reassemblé sur un marbre. ', '', '', 1),
(20061, 'QUISS', 1, 'NQDITT-341\r\nEcart par rapport à la procédure de test qui demande un champ de 100V/m en CRBM - PB général entre 26 et 40GHz suite à une panne d''ampli de puissance et donc on ne peut rayonner que 20V/m\r\nUn ampli en réparation au US - pas de date de retour officiel\r\nUn ampli en MEMs - Pas de confirlmation comme quoi la commande est passée\r\n', '', '', 0),
(20074, 'QUISS', 5, 'equipement non plan ', '', '', 0),
