(11, 'SGDC', 'DIPLEXEUR', 'SPACEBUS', '2014-05-01', '- Pour les vibrations, les diplexeurs FM se feront par 2', '1234456', 2, NULL, 55),
(12, 'ABS-SATMEX', 'C AND KU BAND COMMAND RECEIVER', 'BOEING', '2014-04-18', 'Mise à jour des procédures déjà existantes afin d ajouter les références aux nouvelles fréquences C band et Ku band.\r\nVide : 1310386/931 rev 01/a\r\nVibration : 1317653/932 rev 00/-\r\nEMC : 1311635/933 rev 01/-', '1198040', 4, '2014-03-27', 69),
(20, 'JABIRU', 'KU BAND COMMAND RECEIVER', 'LMCSS', '2014-05-16', 'Pour les 3 procédures, il suffit de faire une mise à jour des procédures déjà existantes pour LMCSS.\nVibration procedure : 984539 / 932\nThermal Vacuum procedure : 982545 / 931\nEMC procedure : 986869 / 933\nLes modifs portent essentiellement sur la mise au template « Thales ». \nCependant, il faudrait aussi  \n-	Supprimer les notions de NG associé au Command Receiver (en 2006, c''était NG, en 2014, ce n''est plus)\n-	Mettre à jour les ref des analyses associées (ex, dans la proc EMC, l''analyse EMC a un nouveau n°)\n-	Vérifier que les normes appelées  et outillages présentés (EMC, vib, etc) sont bien les bonnes. Et côté EMC, vérifier que les harnais sont bien dispo.', '1197942', 4, '2014-04-11', 69),
(21, 'ECHOSTAR 21', 'KA BAND COMMAND RECEIVER', 'LORAL', '2014-05-30', 'Il n y a pas de procédure vibration à écrire car on utilise la procédure générique : 983901/932.\r\nPour les EMC, il n y a que des FM donc faire une procédure tests réduits, mais il faudra quand même faire référence aux NC si il en existe sur du PFM de l affaire JUPITER2.', '1198810', 4, '2014-04-15', 69),
(23, 'ABS SATMEX', 'RX17/12', 'BOEING SYSTEM SATELLITE', '2014-04-30', 'l outillage de vibration existe déjà : ABS SATMEX (FS1+FS2)\r\nanalyses et spec dispo sous des2:RXTLC_Doc_AffABS-SATMEX FS3 FS4ande KU+Proc_envspec pour redaction proc moyens d essais\r\nrécupérer la proc VIBRATION existante (1309695/932 rev00a) et y rajouter le RX17/12\r\nrécupérer la proc VTH existante (1311095/931 rev00-) et y rajouter le RX17/12\r\npour les EMC: une proc réduite (nous n avons que des FMs)', '1198030', 4, '2014-04-16', 93),
(24, 'ABS SATMEX', 'RX KU', 'BOEING SYSTEM SATELLITE', '2014-04-30', 'proc VIBRATION : la meme que pour le RX17/12 .........la raccrocher à tous les articles RX KU\r\nproc VTH: la meme que pour le RX17/12 .........la raccrocher à tous les articles RX KU\r\nproc EMC: tests reduits (RFL + RFS&spray avec photo + notifier quand il y a de la  glue ) - une seule pour les 9 articles...........la raccrocher à tous les articles RX KU', '1198030', 4, '2014-04-16', 93),
(25, 'ABS SATMEX', 'KU BAND DOWNCONVERTER', 'BOEING SYSTEM SATELLITE', '2014-04-30', 'proc VIBRATION: récupérer celle des RX17/12 + RX KU......la raccrocher à tous les articles dans 3IT\r\nproc VTH: récupérer celle des RX17/12 + RX KU......la raccrocher à tous les articles dans 3IT\r\nproc EMC: tests reduits (RFL+RFS&spray tests + photo mesures+ nota quand ajout de  glue ......1 seule pour tous les DOCON KU......la raccrocher à tous les articles dans 3IT\r\n\r\nDocumentations dispos pour vos rédaction: des2:RXTLC_Doc_AffABS-SATMEX FS3 FS4ande KUProc_envspec pour redaction proc moyens d essais', '1198030', 4, '2014-04-16', 93),
(26, 'MPP', 'LDLA KU FLEX', 'SPACEBUS', '2014-05-22', 'Equipements dits Flexibles; le gros de la recette est effectuée en Belgique. \r\nPour ces équipements, uniquement des tests EMC réduits sont requis : \r\n- PFM réduit : test CS suivant les niveaux demandés dans la spécification + un spray test à fréquence centrale\r\n- FMs : spray test à fréquence centrale', '1197733', 4, '2014-04-22', 37),
(31, 'TELSTAR 12V', 'RX TTC', 'ASTRIUM', '2014-06-10', 'La procédure de vibration existe déjà. C est une générique Astrium.\r\nAffaire précédente Astrium => AMU1', '1198473', 4, '2014-05-13', 67),
(32, 'STARONE D1', 'C BAND BPSK COMMAND RECEIVER', 'LORAL', '2014-06-20', 'Réutilisation des procédures de l affaire STARONE C4 pour LORAL.\r\nMise à jour afin d ajouter D1 dans le titre des procédures. \r\nPour la procédure EMC, ajouter la ref de l analyse 1355553/921 et la nouvelle fréquence (modif des tests qui ont un lien avec cette fréquence).', '1198469', 4, '2014-05-30', 69),
