(45, 'E65W', 'SINGLE AND DUAL KU BAND BPSK COMMAND RECEIVER', 'LORAL', '2014-07-30', 'Pour les récepteurs mono il y a un FM et un PFM like.\r\nPFM like : \r\nrandom vib niveau PFM, pas de sinus fort niveau.\r\nVide au températures PFM\r\nEMC réduits.\r\n\r\nIl faut réaliser 3 procédures qui couvrent les mono et les dual. On ne réutilise pas la procédure de vib générique LORAL à cause du PFM like.', '1199084', 4, '2014-07-07', 69),
