(59, 'SGDC', 'RX TTC', 'SPACEBUS 4000 C4', '2014-09-25', 'Héritage:\r\nEQM V2 Flex 3 100V et PFM RXTTC mono Ka Athena Fidus .\r\nDifférences vs Athena : Filtre standard Ka ( spécifique invar sur Athena pour\r\nfiltrage fréquence problématique) + pas de relais TC ON/OFF (Flex 3\r\ntraditionnelle) .', '1199527 ', 4, '2014-09-01', 67),
