(62, 'HR EOS segment 2', 'Modulator', 'AS250', '2014-10-22', 'La procédure de vide ne concerne que le PFM. Les FM''s seront testés en thermique à la PA.\r\nVoir analyse EMC pour la procédure EMC car un FM sera testé en FM+ avec plus de tests qu''un FM classique.\r\nHéritage modulator CSO', '1198903', 4, '2014-09-22', 67),
