(91, 'TELKOM 3S', 'RX ET DOCON KU ET RX C', 'SB4000', '2015-04-09', 'Prendre la procédure Catalogue 1262267 / 931 rev 00/b, \nEn page 1, remplacer : Catalogue par TELKOM 3S\nEn page 5, mettre a la place des xxx/032 : \n200781466W_02 (Docon)\n200781467A_02 (Up conv)\n200781464U_02 (Rx Ku)\n200781470D_02 (Rx C)\nEn page 8 température operating passe à -15 / 55 qualif et (-20 /55 pour le bde C), peut etre qu''il faut prendre une 2° procédure pour le bde C, c''est comme vous voulez\nEn page 10 température operating passe à -10 / 50 acceptance et (-15 /50 pour le bde C)\nEt les températures a modifier sur les profils des pages 14,15, 16, 17\nPour l''equipe : LACOMBE / PUIG / ESPAIGNOL / JUNIET', '1201932', 2, '2015-03-19', 45),
