(98, 'TELKOM 3S', 'RX ET DOCON KU ', 'SB 4000', '2015-04-13', 'C''est pour Telkom 3S, nous avons une différence de température par rapport au catalogue.\nPrendre la procédure Catalogue 1262267 / 931 rev 00/b, \nEn page 1, remplacer : Catalogue par TELKOM 3S\nEn page 5, mettre a la place des xxx/032 : \n200781466W_02 (Docon)\n200781467A_02 (Up conv)\n200781464U_02 (Rx Ku)\n200781470D_02 (Rx C)\nEn page 8 température operating passe à -15 / 55 qualif et (-20 /55 pour le bde C), peut etre qu''il faut prendre une 2° procédure pour le bde C, c''est comme tu veux.\nEn page 10 température operating passe à -10 / 50 acceptance et (-15 /50 pour le bde C)\nEt les températures a modifier sur les profils des pages 14,15, 16, 17\nPour le lien de la procédure 3IT avec les eqts T3S  :\n 1366343 pour Rx 14/12\n 1366344 &amp; 46 pour Dc 14/12\n 1366351 pour Up 14/12\n 1366472 &amp; 73 pour Rx C\n\nPour l''OS : 1201932\nPour l''equipe : LACOMBE / PUIG / ESPAIGNOL / JUNIET\nPour le besoin : dans 3 semaines svp\n\nMerci bcp\n', '1201932', 4, '2015-03-23', 45),
(99, 'TELKOM 3S', 'RX C', 'SB4000', '2015-04-13', 'Remarques: C?est pour Telkom 3S, nous avons une différence de température par rapport au\r\ncatalogue.\r\nPrendre la procédure Catalogue 1262267 / 931 rev 00/b,\r\nEn page 1, remplacer : Catalogue par TELKOM 3S\r\nEn page 5, mettre a la place des xxx/032 :\r\n200781466W_02 (Docon)\r\n200781467A_02 (Up conv)\r\n200781464U_02 (Rx Ku)\r\n200781470D_02 (Rx C)\r\nEn page 8 température operating passe à -15 / 55 qualif et (-20 /55 pour le bde C), peut etre\r\nqu?il faut prendre une 2° procédure pour le bde C, c?est comme tu veux.\r\nEn page 10 température operating passe à -10 / 50 acceptance et (-15 /50 pour le bde C)\r\nEt les températures a modifier sur les profils des pages 14,15, 16, 17\r\nPour le lien de la procédure 3IT avec les eqts T3S :\r\n1366343 pour Rx 14/12\r\n1366344 &amp;amp; 46 pour Dc 14/12\r\n1366351 pour Up 14/12\r\n1366472 &amp;amp; 73 pour Rx C\r\nPour l?OS : 1201932\r\nPour l?equipe : LACOMBE / PUIG / ESPAIGNOL / JUNIET\r\nPour le besoin : dans 3 semaines svp\r\nMerci bcp', '1201932', 4, '2015-03-23', 45),
(101, 'ES Hail2', 'DLA Ka', 'MELCO', '2015-05-22', 'Equipement de type DLA Single avec TM/TC Pulse \r\nPour les EMC, pas de compatibilité avec des harnais existants. ¨\r\nVide thermique sur le PFM.  \r\nVibration avec monitoring de la conso; pour le PFM, sinus bas niveau à faire entre le sinus fort niveau et le random.', '1202442', 4, '2015-04-02', 35),
(102, 'Telkom3S', 'Rx TTC', 'Spacebus4100', '2015-05-06', '-	Suite à EQSR, un «  reduced PFM » est prévu : qualification au niveau thermique, acceptance au niveau vibrations et EMC RE/RS, pour autant que l''analyse EMC  démontre que le CS n''est pas nécessaire vu le PFM E8WB\n', '1178328', 4, '2015-04-07', 67),
