(105, 'MN35-13', 'HR-EOS SEGMENT 2', 'AS250', '2015-05-14', 'Prendre comme héritage la procédure vib de GOKTURK\r\nLa nouvelle procédure devient une procédure générique HR-EOS SEGMENT2 avec les niveaux précisé par un mail d'' Anny Soler du 10/04/2015.\r\n\r\n\r\n', '1198973', 4, '2015-04-13', 229),
(106, 'ESHAIL2', 'COM units', 'DS2000 ', '2015-05-13', 'Les PROC VIBRATION et VTH existent déjà : il faudra les faire évoluer pour qu''elles deviennent génériques pour la plateforme DS2000.\r\n\r\nPROCEDURES EMC: à créer', '1202394 et 1202397', 4, '2015-04-17', 93),
(111, 'ESHAIL 2', 'Ku-band and Ka-band FM command Receiver', 'MELCO', '2015-05-29', 'Il y a 1 PFM en bande Ku et 1 PFM en bande Ka.\r\nIl y a 2 analyse EMC, 1 pour Ku band et 1 pour Ka band. Dans les docs de ref je mets la référence à l''analyse Ku. Voici la ref de l''analyse Ka à mettre dans la proc EMC : 1384316 rev00/-.', '1202389', 4, '2015-04-21', 69),
