(114, 'SSLORAL', 'Ku band FM dual frequency command receiver', 'LORAL', '2015-05-22', 'Ces procédures doivent porter le nom de LORAL mais seront utilisées pour les 2 affaires HISPASAT1 F (article 1367878) et AMAZONAS5 (article 1384091).\r\nLa procédure vibration existe déjà et sera donc utilisée, elle est est générique à tous les programmes pour LORAL, numéro 983901/932 rev03/b.', '1202184', 4, '2015-04-22', 69),
