(127, 'BLAGOVEST FS3 FS4', 'HKU', 'ISS', '2015-07-31', 'Les procedures de test seront les mêmes que pour le HKU BLAGOVEST FS1 sauf les docs applicables qui n''ont plus les mêmes refs :\nLes Tests EMC seront applicables sur le PFM .\n\nTVAC Test Procedure 1 309 616 / 931 00/- 04/03/13\nEMC Test Procedure 1 309 992 / 933 00/- 30/05/13\nMechanical Test Procedure 1 310 405 / 932 00/- 11/03/13\n', '1202129', 4, '2015-05-27', 200),
