(149, 'HYLAS 4', 'C-BAND Command Receiver', 'GEOStar', '2015-08-31', 'Les RX TTC HYLAS4 (numéros 1380748  et  1380751 ) sont des RX TTC récurrents de HYLAS2, hormis que 2 voies TC sont câblées au lieu de 4 voies TC sur HYLAS2). Les exigences de tests sont les mêmes entre HYLAS4 et HYLAS2. Néanmoins les références des documents applicables ont évolués du côté client. Est-il possible, pour faire apparaître la récurrence et minimiser le travail d''écriture,  de faire évoluer l''indice les procédures afin d''y ajouter les références des doc applicables HYLAS4, en le mentionnant dans la table de révision.', '1203124', 4, '2015-08-04', 68),
