(159, 'BLAGOVEST', 'RDIU NG BLAGOVEST', 'EXPRESS-2000', '2015-09-30', 'Pour les RDIU 1&amp;2 NG BLagovest du FLight SET3, les ADs restent les mêmes que pour les RDIU 1&amp;2 des FS1 et FS2. Par contre les équipements ont changé (intégration des fonctions regroupées maintenant dans 5 cartes au lieu de 7 avant) : donc essentiellement nouvel ICD, nouvel IDS et nouvelles analyses thermiques, EMC et vibration, voir sous 3IT sous l''article 1372123.\nPour les procédures, repartir des procédures existantes ci-dessous, et modifier les numéros des documents et ICD, ainsi que les plans de montage/ICD de l''équipement avec le nouvel ICD : partir des procédures suivantes :\n- EMC : 1299400/933\n- VIB : 1298578/932 (prévoir niveaux PFM et FM)\n- VTH : 1298491/931 (prévoir niveaux PFM et FM)\nIntituler la procédure EMC : &quot;Blagovest RDIU 1 NG EMC Test procedure&quot;\nIntituler la procédure VIB : &quot;Blagovest RDIU 1&amp;2 NG Mechanical Test procedure&quot;\nIntituler la procédure VTH : &quot;Blagovest RDIU 1&amp;2 NG Thermal vacuum Test procedure&quot;\nIl reste deux RDIU 1 NG et 2 RDIU 2 NG à fabriquer, seul le premier RDIU 1 NG est un PFM, le deuxième RDIU 1 NG et les deux RDIU 2 NG sont des FMs.', '1201856 ', 4, '2015-09-15', 296),
