(182, 'YENISEI2', 'Ku/C Down-Converter', 'ISS', '2016-04-29', 'Pour les EMC, il faut faire une procedure (en partant de la procédure Yenisei1 ref 1281972/933).\r\nN° de spec différente, même ICD, même IDS, analyse EMC différente\r\nCi-joint les différences entre Yenisei1 et Yenisei2 : modif des frequencs, des PIn et du gain\r\n \r\nPour la procédure de vide, on utilise celle de Yenisei1 ref 1280118/931 en la faisant évoluer.\r\nMêmes températures, mêmes docs, ref de la spec à changer.\r\n\r\nPour la procédure de vibrations, on peut utiliser celle de Yenisei1 ref 1281260/932 en la faisant évoluer\r\nIl faut juste enlever les indices des docs en ADxx et remplacer l’analyse meca 1267310/373 par 1243781/373 (il y avait 2 standard..)\r\nDans la spec pour le sinus, on a 2 oct/mn et ds la procédure 4 oct/mn\r\nIl faut aussi rajouter les pre vib.\r\n', '1203083', 4, '2016-03-30', 44),
