(189, 'LMCSS', 'C, Ku and K band command receiver', 'LMCSS', '2016-06-17', 'Cette demande de procédure concerne 2 affaires pour LMCSS : HELLASAT4 et ARABSAT 6G.\r\nIl faut créer des procédures génériques au nom de LMCSS.\r\ndans le titre, faire apparaître : &quot;C, Ku and K band command receiver&quot;.\r\nIl y a différentes affaires donc différentes analyse à utiliser et à faire apparaître dans les docs de référence :\r\nanalyses mécaniques : 1355943 et 1415588\r\nanalyses thermiques : 1344329 et 1418392\r\nanalyses EMC : 1413391, 1413392 et 1413390\r\nIl y a un mot de passe pour les 2 specs équipement. Il faut les ouvrir avec adobe reader et mettre le mot de passe &quot;TAS CMR &quot;', 'B101655', 4, '2016-05-23', 69),
