(194, 'YENISEI 2', 'UPCONV IF/S UP- CONVERTER', 'ISS  Express 2000', '2016-06-24', 'L''EQM est récupéré de l''EQM UPCON IF/S (OF PD4478) INMARSAT Bande S . les différences entre ces 2 EQM, concernent le changement d''une carte OL interne et une nouvelle carte DCDC.  Les procédures Inmarsat sont 1402044 / 933 , 1400519 / 932, 1403327/ 931\r\n', '1203076', 4, '2016-06-08', 68),
