(201, 'BS1', 'LDLA-15', 'SPACEBUS', '2016-07-01', 'Faire une procédure de test EMC de type PFM qui sera aplliqué sur un seul MV : conformément à l’analyse EMC 1426424/921 et à l’EQSR , faire :\r\nBonding, In rush, CS sur secondaire.', 'B103112', 4, '2016-06-28', 36),
