(203, 'BS1', 'C band  command receiver', 'SPACEBUS 4000', '2016-09-21', 'Procedure EMC : 2 procédures distinctes, 1 pour les mono (1411802 et 1411803) et 1 pour le flex (1411804) car 2 analyses différentes.\r\nProcedure vibration : pas de procedure pour le flex (1411804 PFM), on réutilise la 1386801/932 . pour les monos (1411802 et 1411803) écrire une procédure (nouveau numéro) par recopie de la procédure Telkom3S ( 1392758/932) et la nommer Spacebus 4000.\r\nLa specification pour les mono est la TCR-ASP-SP-17  rev08\r\nLa specification pour le flexible est la 200774846D rev01\r\nProcedure vide : écrire une procédure commune aux mono et au flex en la nommant spacebus 4000 en appelant les 2 analyses thermiques (1313588 pour les mono et 1330648 pour le flex) car même nombre de cycles et mêmes temperatures.', 'B103107', 4, '2016-08-12', 69),
(204, 'SWIM', 'Instrument PFM', 'AIT', '2017-01-02', 'La procedure pour l''instrument SWIM EM (1358403/933) existe  mais le test sur l''EM est limité au CE. Je propose de faire une autre procedure pour le PFM', '1187098', 4, '2016-09-06', 343),
