(220, 'T16', 'K band single and dual FM command receiver', 'ADS', '2016-11-10', 'Pour les vibration, on utilise la procédure générique 1280793/932 rev03/b.\r\nProcédure vide et EMC commune aux singles et dual.', 'B105867', 4, '2016-10-13', 69),
(221, 'TELKOM4S', 'C band command receiver', 'LORAL', '2016-11-24', 'Les procédures de vibration et de vide sont directement utilisables pour ce programme donc pas besoin de générer de doc.\r\nEMC : mise à jour de la procédure pour prendre en compte les fréquences du programme. Le contenu  de la procédure reste le même.\r\nLa référence de la spec G010020 à utiliser (pour les freq) est à l''indice 4.', 'B105855', 4, '2016-10-21', 69),
