(225, 'SWOT KaRIn', 'Boitier Hyperfrequence', 's', '2017-01-13', 'Besoin de procédure CHOC\r\nPour info:\r\nLe n° article EM est 1348800 (ICD dentique au VT Meca )\r\nLe n° article FM est 1416792', '1203250', 4, '2016-10-28', 359),
