(227, 'MYRIADE EVOLUTION', 'ANTENNE CHELTON MYRIADE', 'MYRIADE EVOLUTION', '2016-11-24', 'Voir Analyse méca 1392365/373 Rev02/- §1.2 pour l''aspect random.', '1203047', 4, '2016-11-15', 182),
(228, 'SWOT', 'RX GNSS', 'MYRIADE EVOLUTION', '2017-01-03', 'RX GNSS SWOR &quot;récurrent&quot; du RX GNSS MYRIADE mais quelques delta de spec à prendre en compte pour les tests mécaniques des MV', 'B108064', 4, '2016-12-07', 182),
(229, 'E7C', 'ku band single &amp; dual command receiver', 'LORAL', '2017-01-20', 'Pour les vibrations, on utilise la procédure générique LORAL 983901/932.\r\nLes procédures vide et EMC sont à écrire en partant des procédures du précédent programme E65W (vide : 1368857/932 et EMC : 1366637/933).\r\nLes articles 1431357 et 1431359 sont des FM.\r\nIl y a 2 spécifications : E657071 Rev3 et E657073 Rev3.\r\nLes cycles sont décrits dans le test plan et les températures sont définies dans les 2 spécifications (tableau en fin de spec).\r\nIl y a 2 analyses EMC une pour les mono 1445546/921 et une pour les bi-têtes 1445543/921.\r\nIl y a 2 analyses thermiques une pour les mono 1271245/374 et une pour les bi-têtes 1211704/374.\r\nPour l''article 1431361, il y a un PFM et un FM.', 'B106412', 4, '2016-12-14', 69),
(230, 'SWOT', 'ANTENNE CHELTON MYRIADE', 'MYRIADE EVOLUTION', '2017-01-15', 'Similaire procédure VIB Antenne CHELTON MYRIADE EVOLUTION (demande n°227) sauf pour les niveaux Random', 'B108064', 4, '2016-12-15', 182),
(231, 'YAMAL 601', 'Docon Dual Ka', 'Spacebus', '2017-01-27', '1 - Procédure générique Spacebus Docon Dual Ka\r\n2 - Analyse ECM en cours, voir C. REBECHE\r\n3 - Analyse VTH en cours, voir P. JOUAN DE KERVENOAEL', 'B106866', 4, '2017-01-09', 365),
(232, 'P18', 'LDLA Ku', 'Spacebus', '2017-02-01', 'Bonjour,\r\nPas de PFM sur cette affaire, il s''agit juste de rattacher la procédure EMC standard à ces deux articles', 'B103633', 4, '2017-01-16', 35),
(233, 'P18', 'LDLA Ka', 'Spacebus', '2017-02-06', 'Le PFM sera un type 3 BSS', 'B103627', 4, '2017-01-16', 35),
(234, 'YENISEI-A1', 'DOCON Q/C', 'ISS', '2017-02-24', 'procedure VTH uniquement pour EQM+PFM.attention : pas de cycle OL (équipement sans OL)\r\nprocedure VIB: unit ON pendant les VIB \r\nprocedure EMC complète pour l''EQM et réduite pour PFM+FM', 'OSB103778', 4, '2017-01-31', 93),
(235, 'Syracuse4', 'BFN', 'NeoSat', '2017-03-29', 'T0 contractuel : 21/12/15 - 1 EQM, 1 PFM T0+20, 1 FM T0+28', 'B104282 ', 4, '2017-01-30', 374),
(236, 'P18', 'APME', 'LPE', '2017-04-14', 'Vibration\r\nSuite demande PMO/client et au refus de la RFD sur les sinus fort niveau, il sera appliqué sur l’équipement une séquence complète PFM avec sinus fort niveau sans le harnais. Afin de ne pas stresser la connectique, le harnais sera uniquement monté pour la partie random.\r\n\r\nPar conséquent, afin d’optimiser les montages/démontages des harnais/équipement, il est décidé de faire la séquence vibration suivante :\r\n-	Montage de l’équipement sur le pot sans harnais\r\n-	Axe X sinus fort niveau\r\n-	Axe Y sinus fort niveau\r\n-	Montage du harnais\r\n-	Axe Y random\r\n-	Axe X random\r\n-	Axe Z random\r\n-	Démontage du harnais\r\n-	Axe Z sinus fort niveau\r\n\r\nCette séquence devra apparaître dans la procédure avec une mention comme quoi elle peut effectuée dans les 2 sens (séquence X-&gt;Z ou Z-&gt;X) en fonction de la disponibilité des moyens utilisés.\r\n\r\nNiveaux PFM à appliquer : cf Annexes\r\n\r\nVTH\r\n \r\n4 cycles operating avec un cold start sur n’importe quel palier froid. Cf t° en Annexe.\r\n\r\nEMC : la procédure a déjà été faite dans le cadre de l’EQM RDIU EQM8\r\n\r\n\r\n\r\n', 'B10365501', 4, '2017-01-30', 184),
(237, 'SYRACUSE IV', 'CVSHF', 'NEOSAT', '2017-05-30', 'initialisation d une procedure pour l EM  suivant PDR \r\nsur EM pas de vibration pas de vide thermique juste EMC ESD \r\npour le PFM et le FM    initialisation de la procedure de vide et de vibration ', 'B104288', 4, '2017-05-17', 185),
(238, 'YENISEI-A1', 'DOCON K/S', 'ISS', '2017-02-24', 'procedure  VTH  uniquement  pour  EQM+PFM.   attention  :  pas  de  cycle  OL en VTH (équipement avec OL ref externe)\r\nprocedure VIB: unit OFF pendant les VIB \r\nprocedure EMC complète pour l''EQM et réduite pour PFM+FM', 'OSB103783', 4, '2017-01-31', 93),
(239, 'YENISEI-A1', 'UPCONV C/K', 'ISS', '2017-02-24', 'procedure  VTH  uniquement  pour PFM.attention  :  pas  de  cycle  OL  (équipement avec OL ref externe)\r\nprocedure VIB: unit OFF pendant les VIB \r\nprocedure EMC complète pour le PFM et réduite pour FM', 'OSB103783', 4, '2017-02-01', 93),
(240, 'SENTINEL C&amp;D', 'X-BAND 8PSK MODULATOR', 'NA', '2017-03-06', 'HERITAGE: EQM/PFM Sentinel et PFM COSMO SG.\r\nSENTINEL C&amp;D est la suite de SENTINEL A&amp;B avec 6 satellites également\r\n(S1C/S1D, S2C/S2D, S3C/S3D).\r\nClient final ESA, 3 Prime (TAS-I pour S1, ASD GMBH pour S2, TAS-F Cannes pour\r\nS3), client direct TAS-E responsable du TXA.', 'B10473001', 4, '2017-02-07', 67),
(241, 'ATLAS RXTTC NG', 'RXTTC NG KU CAN', 'NEOSAT', '2017-03-17', 'Pas d''analyse fait pour cet EQM.\r\ndocuments applicables SPACEBUS NEO et DIET E3000\r\nHéritage EQM1 : ref 1425253_931\r\n- Prendre un nouveau numéro\r\n- retirer la référence de l’analyse\r\n- Mettre à jour le 3D\r\n- Changer les températures (TFQ min = -35°C)', 'B107738', 4, '2017-02-24', 365),
(242, 'ATLAS RXTTC NG', 'RXTTC NG KU CAN', 'NEOSAT', '2017-03-17', 'Pas d''analyse fait pour cet EQM.\r\ndocuments applicables SPACEBUS NEO et DIET E3000\r\nPoint spécifique : traiter l’aspect ESD permettant de couvrir E5WB (GERT)\r\n', 'B107738', 4, '2017-02-24', 365),
