(251, 'Catalogue', 'Tous', 'Multi-plateformes', '2017-04-24', 'Il s''agit d''une évolution de la procédure citée ci-dessus (1262555 02/-).\r\nLa modif consiste à prendre en compte le remplacement de &quot;Sine Survey&quot;  par  &quot;Random Survey&quot;.', 'OSB103625', 4, '2017-03-27', 325),
