(263, 'Sentinel 3C', 'DPU Sentinel', '-', '2017-06-01', 'Voir le mail de Didier Gertz du 09/05/17:\r\n\r\nIl faut repartir de la procédure de test mécanique de S3A/S3B ref. 1237434/932 issue 02-, la mettre à jour (ajout pré-vib) et la compléter pour tester aux chocs la carte DSP2 EQM code 1416764 00 (dans le bac du DPU EM complété avec des cartes lest)\r\n\r\nSpécifications applicables :\r\n- Specification DPU ref. S3R-RS-TAF-RA-10095 issue 1\r\n- Sentinel 3 Environment and Tests Requirements ref. S3-RS-TAF-SY-00208 issue 8\r\n', 'B103574', 4, '2017-05-10', 185),
