(288, 'LDLA 15 with CAN interface', 'Dual LDLA Ka', 'Spacebus NEO', '2017-08-25', 'EQM sera testé en VIB + Chocs + VTH + EMC\r\nIl n''y a pas de tests PFM/FM (fait au niveau LCTWTA par TAS-B\r\nPour les signatures : IRP : Watier, IES : Tomislav Bukovac, QA : M. Bataille\r\nPour la procedure VTH, partir de la procedure 1403619/931 dans lequel on supprime la figure 5 \r\n    doc applicable : test plan 1475097/957   + see CIDL\r\n\r\nProcedure Vibration : prendre les niveaux multi plateforme de l''analyse meca\r\n                              \r\n', 'B103920', 4, '2017-07-21', 44),
(289, 'EG1', 'LDLA15', 'SPACEBUS', '2017-09-04', 'PFM : article 1429207 (HD LDLA Ka 20,2-21,2)\r\n\r\nATTENTION : modification de la matrice de test dans l''analyse EMC (1465322/921 00/-) suite à discussion avec M. Lubineau. Une note de justification de réduction de tests sera faite par F. Bac.\r\nLes tests à réaliser sur le PFM sont les suivants :\r\n-	Sine Wave Injection (§ 5.2)\r\n-	RS E-Field AC (§ 6.6) juste pour la bande Tx Ka\r\nLe test à réaliser sur les FM est le suivant :\r\n-	RS E-Field AC (§ 6.6) spray only', 'B106237', 4, '2017-07-28', 36),
