(298, 'E5WB', 'Ku band command receiver', 'ORBITAL', '2017-09-22', 'Il ya 2 types d''équipement sur cette affaire.\r\n2 RX TTC bande KU single AG (1 PFM + 1 FM) et 2 RX TTC bande Ku dual NG (1 PFM + 1 FM).\r\nIl y a des analyses spécifiques RX AG et  des analyses spécifiques NG.\r\nNous souhaitons faire 1 seule procédure pour les 2 types AG et NG. \r\nDans la demande je ne mets que les analyses AG. Voici toutes les références d''analysess:\r\nanalyse thermique :\r\nAG 1390191/974 rev 03/-  \r\nNG 1474360/374 rev00/-\r\nAnalyse mécanique :\r\nAG 933257/373 rev 04/a\r\nNG 1409472/373 rev00/-\r\nAnalyse EMC :\r\nAG 1472275/921 rev00/-\r\nNG 1472277/921 rev00/-\r\n\r\n', 'B108475', 4, '2017-08-25', 69),
