(339, 'BB4A', 'Ku band command receiver', 'SPACEBUS NEO', '2018-01-26', 'Première affaire RXTTC NG.\r\nLes procédures vibration et vide seront des procédures génériques pour SPACEBUS NEO avec pour titre &quot;C, Ku, K and Ka band COMMAND RECEIVER&quot;. Conformément au mail de synthèse reçu par Luc et Fred, ces procédures ne doivent contenir que la description générale du test, les infos dédiées à l''affaire sont contenues dans le test plan. Pour les documents applicables, mettre Cf CIDL.\r\nLa procédure EMC est bien dédiée à l''affaire BB4A.', 'B103918', 4, '2017-12-14', 69),
