(348, 'Express 80 &amp; 103', 'RDIU', 'LPE', '2018-02-10', 'Pour les RDIU Express 80 &amp; 103 (article 145098401, OFs PE2424 et PE2436), nous avons voulu appliquer notre plan de test standard, mais cela n''a pas été accepté.\r\n\r\nNous avons préparé un plan de test spécifique : https://www-ecm.thalesaleniaspace.fr/ecm/livelink.exe/open/0005-0009271034\r\n\r\nLa différence se situe uniquement en VTH : T° max et nombre de cycles.\r\n\r\nPouvez-vous préparer la procédure spécifique correspondante, basée sur la 1298491/931 ?\r\nPour  la page de garde : \r\n•	B. Morhain -&gt; Th. Vieu\r\n•	F. Puig -&gt; J. Michot', 'B10684601', 4, '2018-01-31', 184),
