(351, 'KMILSAT 1', 'X and Ka band command receiver', 'EUROSTAR 3000', '2018-03-02', 'A priori pour l''instant, pas de procédure vibration à écrire, on utilisera la procédure générique ADS 1280793. A confirmer par Clément dans la semaine.\r\n1 procédure de vide à écrire commune aux X band et Ka band (même nombre de cycles et même températures).\r\nEMC : possibilité 1 procédure X band / Ka band commune ou 1 procédure dédiée à chaque bande.\r\nles spécifications sont :\r\nX band  : KM1-SP-ADST-1000114750 rev 02\r\nKa band : KM1-SP-ADST-1000114749 rev 03\r\nICD\r\nX band : 1466419 rev 00/-\r\nKa band : 1466420 rev 01/-\r\nanalyses EMC\r\nX band : 1483066 rev 00/-\r\nKa band : 1483065 rev 00/-\r\nIDS, test plan, analyse thermique, analyse méca, identiques pour les 2 bandes.\r\nPour info : je mets en ref pour la demande les doc du X band.', 'B109918', 4, '2018-02-05', 69),
