(364, 'INMARSAT GX5', 'Ka band commande receiver', 'Spacebus 4000', '2018-08-06', 'Pas de procédures vibration et vide à écrire. On se sert des procédures génériques sus mentionnées. Toutes les infos de niveaux et de températures sont dans le test plan générique(1519203/957) ou le test plan spécifique (1519234/440).\r\nLa procédure EMC est à écrire.', 'B110454', 4, '2018-07-09', 69),
(365, 'STARONE D2', 'C band BPSK command receiver', 'LORAL', '2018-08-10', 'Pas de procédure vibration à écrire, on utilise la procédure générique 983901/932.\r\nNouvelles procédures de vide et EMC.\r\nPour la procédure vide : les nombre de cycle est dans la matrice de la séquence dans le test plan, les températures sont dans la specification équipement G057566 en page 38.', 'B112658', 4, '2018-07-11', 69),
(366, 'SES17', 'Ku band command receiver', 'SPACEBUS NEO', '2019-08-13', 'pas de procédures vibration et vide à écrire, on utilise les procédures génériques qui décrivent l''environnement 1518010/932 et 1500289/931. Les informations pour les niveaux de vibration et les températures sont dans le test plan spécifique de l''affaire 1508412/957.\r\nprocédure EMC à écrire, il y a 2 analyse EMC, 1 pour l''AG 1504823 et 1 pour le NG 1501945.\r\nSpécification pour le RX AG : 200913910J\r\nSpécification pour le RX NG : 200898627V\r\nAttention 2 types d''équipements sur cette affaire : 1 RXTTC AG (PFM) et 2 RXTTC NG (PFM)', 'B107144', 4, '2018-07-13', 69),
(367, 'APSTAR 6D', 'DC Ka/KU', 'CAST', '2018-08-31', 'VIBRATIONS :\r\nLa procédure VIBRATIONS 1168870/932  doit être applicable mais c''est à vérifier !!\r\nCependant elle va nécessiter une évolution sur le paragraphe &quot;Documents applicables&quot; (/041 /373).\r\nVTH :\r\nLa procédure VTH 1355832/931  doit être applicable mais c''est à vérifier !!\r\nCependant elle va nécessiter une évolution sur le paragraphe &quot;Documents applicables&quot; (/041 /374) ainsi que la prise en compte de la RFD 200555962K.\r\nEMC :\r\nLa procédure EMC est à rédiger en tenant compte de la RFD 200865736U.\r\n', 'B110982', 4, '2018-08-02', 325),
