(384, 'TURKSAT-5B', 'X Down-converter', 'EUROSTAR 3000 EOR', '2019-01-16', NULL, 'B112904', 4, '2018-11-30', 325),
(385, 'TURKSAT-5B', 'X Down-converter', 'EUROSTAR 3000 EOR', '2019-01-18', 'Suite à des discussions avec le client (ADS) qui s''éternisent, le Test Plan à prendre en compte (01-) est en version draft non signé. Je vous l''enverrai par mail.\r\nIl y a quelques point particuliers tels que :\r\n- des tests initiaux en vide.\r\n- La présence du Bus 100v, mais équipement OFF lors de la mise en vide pour les cycles OFF.\r\n', 'B112904', 4, '2018-12-18', 325),
