(393, 'Konnect VHTS', 'Ka BAND TRACKING RECEIVER', 'Spacebus NEO', '2019-07-02', 'Pas d''essais de vibration et choc sur l''EQM.', 'B113418', 4, '2019-06-04', 67),
(394, 'Konnect VHTS', 'LNA Switch Matrix', 'Rx Telecom', '2019-08-09', NULL, 'OSB113291', 4, '2019-06-05', 55),
(395, 'KONNECT - VHTS', 'MCU', 'NEO', '2019-09-25', '3 FMs seulement \r\ndu RE/RS (sniff et spray)\r\npour le RE, se rapprocher de Michel Terral (fréquence)\r\n\r\npour la redaction de cette proc EMC reduite, s''inspirer de celle ecrite sur MLO SES17 (ref 1538213_01_-206E)', 'OSB 113413', 4, '2019-08-29', 93),
(396, 'KONNECT VHTS', 'Signal Combiner ', 'Spacebus Neo', '2019-09-16', NULL, 'OSB113295', 4, '2019-09-02', 429),
(397, 'KONNECT-VHTS', 'LDLA Q band', 'SPACEBUS NEO', '2019-10-04', NULL, 'OSB113399', 4, '2019-09-05', 36),
(398, 'YENISEI 2 - P3', 'K/KA UP-Converter ', 'Express 1000H', '2019-10-04', 'VTH : Pour créer cette procédure, vous pouvez utiliser comme base de travail la proc standard (1280118/931 01-).\r\n          Par contre, la photo de l''équipement ne correspond pas. Voir aussi pour la position des thermocouples.\r\n\r\nEMC : Procédure à créer\r\n\r\nVibration : Pour créer cette procédure, vous pouvez utiliser comme base de travail la proc (1430802/932 00-).              ', 'B111846', 4, '2019-09-05', 325),
(399, 'AMU 3 ', 'Docon Ku Flex', 'Express 1000H', '2019-10-14', 'même procédure pour type 2 1524709', '12206088', 1, '2019-09-09', 511),
(400, 'AMU 3', 'Docon Ku Flex', 'Express 1000H', '2019-10-11', 'Deux types d''équipements : Type 1 (LO 3300) et Type 2 (LO 2800).\r\n1 seul procédure VTH, 1 seul procédure vibration, 1 procédure EMC en référençant les deux types.', 'B114276', 4, '2019-09-24', 511),
(401, 'HOTBIRD F1-F2', 'Ku band flexible command receiver', 'ASTRIUM', '2019-10-31', 'Il n''y a que la procédure EMC à écrire.\r\nPour les vibrations et le vide on utilisera les procédures génériques et les test plans suivants :\r\nvibration \r\nprocédure générique 1518010 00/- et test plan 1556756 00/-\r\nvide\r\nprocédure générique 1500289 00/- et test plan 1557761 00/-', 'B115543', 4, '2019-10-03', 69),
(402, 'K-VHTS', 'K-VHTS Rx Ka/C', 'Spacebus NEO', '2020-11-07', 'Se baser sur les procédures de SES17 : Test TROL en VTH.', 'OSB113382', 4, '2019-10-11', 432),
(403, 'K-VHTS', 'K-VHTS DC V/C', 'Spacebus NEO', '2019-12-12', NULL, 'OSB113382', 4, '2019-10-11', 432),
(404, 'K-VHTS', 'K-VHTS Up C/Ka', 'Spacebus NEO', '2019-11-13', 'Bonjour ,\r\n\r\nSe baser sur les procédures SES 17 CCOB\r\nPas de cycles ON en VTH sur le PFM juste l''OL', 'OSB113382', 4, '2019-10-11', 432),
(405, 'K425', 'Channel Filter', 'observation', '2019-11-22', 'Chaque équipement est composé par 2 channels filters', 'B117778', 4, '2019-10-23', 62),
(406, 'MEASAT 3D', 'DOWN CONVERTER CL', 'EUROSTAR 3000', '2020-01-31', 'Voir le mail de BARON S. pour FERRIE L., du 10/01 à 17h18 !!\r\nToutes les infos sur trouvent dans ce mail et surlignées en jaune. Il faut éffectuer des vibrations, des Micro-vibrations et des chocs\r\n\r\nLa qualif initiale sans cette carte était portée à l’époque par l’EQM PC4898 Astra-EGNOS.\r\nEn terme de niveaux, il va donc falloir faire un mix entre MEASAT et l’héritage ASTRA-EGNOS mais aussi avec ARTES pour la partie micro vib faite en fin d’année dernière sur l’EQM CCoB.\r\n\r\nPOUR INFO, J''AI ENREGISTRE UN DOCUMENT &quot;BIDON&quot; (SPECIFICATIONS ENVIRONNEMENT) POUR DEBLOQUER VOTRE OUTIL MAIS NE PAS EN TENIR COMPTE !!!!!\r\nIL M''EST IMPOSSIBLE D''ENREGISTRER L''EQSR. JE L''ENVERRAI PAR MAIL A LUC FERRIE.', 'B116967', 4, '2020-01-10', 325),
(407, 'test', 'test', 'test', '2021-01-24', NULL, 'test', 1, '2020-01-16', 564),
(408, 'test', 'test', 'test', '2021-01-14', NULL, 'test', 4, '2020-01-16', 564),
(409, 'SPAINSAT', 'MCU', 'E3000', '2020-03-16', '- OS B11442101 pour PFM et 1FM (SAT1)\r\n- OS B11776501 pour 2FM (SAT2)', 'B11442101', 4, '2020-03-05', 511),
(410, 'KVHTS', 'DTP5G', 'SpaceBus NEO', '2020-04-02', 'Le DTP5G KVTS est composé de 5 ilots (3 RxTx et 2 SWCH). La recette, et donc le VTH et les EMC, ne se fera qu''avec 2 ilots, un RxTx couplé à un SWCH. \r\nChaque ilot sera vibré séparement.', 'B113284', 4, '2020-03-02', 540),
(411, 'MEASAT3D', 'Down-converter C/L', 'Eurostar 3000 Std', '2020-04-03', 'L''héritage de cette affaire est E5WB Down-converter.\r\nPour le VTH et les vibrations, vérifier les procédures déjà existantes (E5WB Down-converter C/L) pour pouvoir les réutiliser mais en modifiant les titres, etc,etc.... A vérifier !!!\r\nPour les EMC, s''inspirer de la procédure de E5WB Down-converter C/L en mettant à jour les bandes de fréquences.', 'B116968', 4, '2020-03-02', 325),
(412, 'HOTBIRD', 'Down-converter C/L ', 'Eurostar Neo', '2020-04-10', 'L''héritage de cette affaire est E5WB Down-converter (voir demande MEASAT3D DC C/L).\r\nPour le VTH et les vibrations, vérifier les procédures déjà existantes (E5WB Down-converter C/L) pour pouvoir les réutiliser mais en modifiant les titres, etc,etc.... A vérifier !!!\r\nPour les EMC, s''inspirer de la procédure de E5WB Down-converter C/L en mettant à jour les bandes de fréquences.\r\n', 'B116961', 4, '2020-03-02', 325),
(413, 'E10B', 'RxTTC Bande Ku PM FM CDMA', 'Space Bus Neo', '2020-06-25', 'Une seule procédure pour les deux types. Seules les fréquences à l''allumage sont différentes pour les deux types', 'B119229', 1, '2020-06-17', 429),
